import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  Grid,
  Paper,
  Typography,
  Button,
  Box,
  LinearProgress,
  Card,
  CardContent,
} from '@mui/material';
import { dashboardAPI } from '../services/api';

function Dashboard() {
  const [lastSession, setLastSession] = useState(null);
  const [progress, setProgress] = useState(null);
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const [sessionRes, progressRes, statsRes] = await Promise.all([
          dashboardAPI.getLastStudySession(),
          dashboardAPI.getStudyProgress(),
          dashboardAPI.getQuickStats(),
        ]);

        setLastSession(sessionRes.data);
        setProgress(progressRes.data);
        setStats(statsRes.data);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return <LinearProgress />;
  }

  return (
    <Box>
      <Grid container spacing={3}>
        {/* Last Study Session */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Last Study Session
            </Typography>
            {lastSession ? (
              <>
                <Typography variant="body1">
                  Group: {lastSession.group_name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {new Date(lastSession.created_at).toLocaleString()}
                </Typography>
                <Button
                  component={RouterLink}
                  to={`/study_sessions/${lastSession.id}`}
                  variant="outlined"
                  sx={{ mt: 1 }}
                >
                  View Details
                </Button>
              </>
            ) : (
              <Typography>No study sessions yet</Typography>
            )}
          </Paper>
        </Grid>

        {/* Study Progress */}
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Study Progress
            </Typography>
            <Box sx={{ mb: 2 }}>
              <Typography variant="body2" color="text.secondary">
                Words Studied: {progress?.total_words_studied || 0} / {progress?.total_available_words || 0}
              </Typography>
              <LinearProgress
                variant="determinate"
                value={(progress?.total_words_studied / progress?.total_available_words) * 100 || 0}
                sx={{ mt: 1 }}
              />
            </Box>
          </Paper>
        </Grid>

        {/* Quick Stats */}
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Quick Stats
            </Typography>
            <Grid container spacing={2}>
              {stats && (
                <>
                  <Grid item xs={6}>
                    <Card>
                      <CardContent>
                        <Typography color="text.secondary">Success Rate</Typography>
                        <Typography variant="h5">{stats.success_rate}%</Typography>
                      </CardContent>
                    </Card>
                  </Grid>
                  <Grid item xs={6}>
                    <Card>
                      <CardContent>
                        <Typography color="text.secondary">Study Sessions</Typography>
                        <Typography variant="h5">{stats.total_study_sessions}</Typography>
                      </CardContent>
                    </Card>
                  </Grid>
                  <Grid item xs={6}>
                    <Card>
                      <CardContent>
                        <Typography color="text.secondary">Active Groups</Typography>
                        <Typography variant="h5">{stats.total_active_groups}</Typography>
                      </CardContent>
                    </Card>
                  </Grid>
                  <Grid item xs={6}>
                    <Card>
                      <CardContent>
                        <Typography color="text.secondary">Study Streak</Typography>
                        <Typography variant="h5">{stats.study_streak_days} days</Typography>
                      </CardContent>
                    </Card>
                  </Grid>
                </>
              )}
            </Grid>
          </Paper>
        </Grid>

        {/* Start Studying Button */}
        <Grid item xs={12}>
          <Button
            component={RouterLink}
            to="/study_activities"
            variant="contained"
            size="large"
            fullWidth
            sx={{ mt: 2 }}
          >
            Start Studying
          </Button>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Dashboard;
